export async function getConnection() {
    try {
        const response = await fetch('https://cors-anywhere.herokuapp.com/https://www.metaweather.com/api/location/44418/');
        const data = await response.json();
        console.log(data);
    } catch (error) {
        console.log('ERROR');
    }
}
